  false,\n\t\"url\": null,\n\t\"notes\": \"This tabular data set represents the average
  contact time, in units of days, compiled for every MRB_E2RF1 catchment of Major
  River Basins (MRBs, Crawford and others, 2006). Contact time, as described in Vitvar
  and others (2002), is defined as the baseflow residence time in the subsurface.
  The source data set was the U.S. Geological Survey's (USGS) 1-kilometer grid for
  the conterminous United States (D.M. Wolock, U.S. Geological Survey, written commun.,
  2008). The MRB_E2RF1 catchments are based on a modified version of the U.S. Environmental
  Protection Agency's (USEPA) RF1_2 and include enhancements to support national and
  regional-scale surface-water quality modeling (Nolan and others, 2002; Brakebill
  and others, 2011). Data were compiled for every MRB_E2RF1 catchment for the conterminous
  United States covering New England and Mid-Atlantic (MRB1), South Atlantic-Gulf
  and Tennessee (MRB2), the Great Lakes, Ohio, Upper Mississippi, and Souris-Red-Rainy
  (MRB3), the Missouri (MRB4), the Lower Mississippi, Arkansas-White-Red, and Texas-Gulf
  (MRB5), the Rio Grande, Colorado, and the Great basin (MRB6), the Pacific Northwest
  (MRB7) river basins, and California (MRB8).\",\n\t\"owner_org\": \"bd2cdd5a-4d65-46c0-9937-c8381175f104\",\n\t\"extras\":
